import{_ as s,c as a,o as i,a5 as p}from"./chunks/framework.B33oykO0.js";const t="data:image/png;base64,",n="/assets/0dc0ef9f18c24b9985fdbc3387e6e3cc-1652690860051.CRK7QKPi.png",l="/assets/014c97a9d38b485d8f9d4140e771394f-1652690867314.BG-Y34yd.png",b=JSON.parse('{"title":"注释","description":"","frontmatter":{},"headers":[],"relativePath":"docs/code/java/primary/6-注释.md","filePath":"docs/code/java/primary/6-注释.md","lastUpdated":null}'),e={name:"docs/code/java/primary/6-注释.md"},h=p(`<h1 id="注释" tabindex="-1">注释 <a class="header-anchor" href="#注释" aria-label="Permalink to &quot;注释&quot;">​</a></h1><p>无论是多么贴近人类认知的编程语言所写出来的代码，在阅读代码的时候都要编程人员通过上下文的逻辑关系甚至深究其中的调用过程从而了解运行逻辑。在一个工程的开发过程中，要不断的有人去修复Bug，解决异常或者扩展功能，这些操作都将对已有的程序进行阅读，如果程序封装层次较深，逻辑不够清晰，阅读成本是很高的。</p><p>如果能在程序中通过人类语言进行介绍，那将有助于阅读人员快速理解程序的逻辑与调用过程，也就能更快的缩短开发时间降低成本。</p><p>注释虽然写在程序中，但不会参与程序的编译，也就是说注释不会被添加进class文件中，也不会影响原有的程序。</p><ol><li>多人开发的项目中，可以通过注释介绍每一个语句的作用以及逻辑，能够让使用者或者阅读者快速的了解代码的含义与原理。</li><li>对于自己来讲，在开发过程中勤加注释也能在未来阅读自己的逻辑时方便优化。</li></ol><p>为方便描述程序具体运行内容或屏蔽部分无用代码使其无法执行，可使用特殊的标签符号在程序中书写自然语言字符，这种包裹自然语言字符的标签被称为注释。</p><p>注释是每一种语言中最容易学会的技能，确实实际开发过程中最常用的技能，合理的使用注释可以创造出优秀的代码，并且在一定程度可以引导自己不断成就更好的代码和逻辑。</p><h2 id="行内注释" tabindex="-1">行内注释 <a class="header-anchor" href="#行内注释" aria-label="Permalink to &quot;行内注释&quot;">​</a></h2><div class="language-java vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">java</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">System.out.</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">print</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">(</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;hello&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">);</span><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">//这是一个打招呼的语句</span></span></code></pre></div><p>单行注释由两个斜杠组成，将把两个斜杠以后，换行符之前的代码进行忽略。比较适用于在语句后添加注释。 由于到达一个换行符后就会注释停止，所以单行注释是不能跨行使用的，如果在多行中进行注释，则要在多行中分别使用单行注释。</p><h2 id="多行注释" tabindex="-1">多行注释 <a class="header-anchor" href="#多行注释" aria-label="Permalink to &quot;多行注释&quot;">​</a></h2><div class="language-java vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">java</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">/*</span></span>
<span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">    注释的内容</span></span>
<span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">    并且可以跨越多行</span></span>
<span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">*/</span></span></code></pre></div><p>多行注释分为两部分，斜杠加星号为开头符号，星号加斜杠为结束符号。开头符号到最近的结束符号之间的内容将被注释。开始与结束符号之间内容不限，可以是换行符，也就是说多行注释是可以跨行进行注释的。</p><p>由于结束符号是从最近的结束符号来控制的，所以多行注释是不能嵌套的，会遗漏一部分代码和结束符号在外部：</p><div class="language-java vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">java</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">/* ← 此为开始符号</span></span>
<span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">	/*</span></span>
<span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">	↓ 此为正常结束符号 </span></span>
<span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">	*/</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">此处的代码不会被注释</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">这个结束符号也不会被注释 → </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">*/</span></span></code></pre></div><h2 id="文档注释" tabindex="-1">文档注释 <a class="header-anchor" href="#文档注释" aria-label="Permalink to &quot;文档注释&quot;">​</a></h2><div class="language-java vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">java</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">/**</span></span>
<span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">  * 这个方法用于输出一个helloworld</span></span>
<span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">  */</span></span>
<span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">public</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> static</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> void</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;"> main</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">(</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">String</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">[] args){</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">    System.out.</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">println</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">(</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;helloworld&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">);</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">}</span></span></code></pre></div><p>文档注释一般是写在方法或者类上的，文档注释类似多行注释，但是开头符号是两个星号，一般情况下文档注释中的每一行的开头都会以星号开头。</p><p>文档注释中会存在很多特定的参数，这些参数将用于表述类的作者和创建时间，以及方法的参数返回值等信息，这些信息将用于生成介绍文档内容。</p><p>通过文档注释的代码易读性更高，并且可以通过文档注释生成html格式的文档笔记，来系统的对程序代码进行查阅和解释。生成文档要借助<code>javadoc</code>指令来完成，首先要将命令行定位到Java文件所在路径下，然后执行<code>javadoc -d 文件夹名 java文件名.java</code>，其中的文件夹名表示将文档存放到哪里：</p><p><img src="`+t+'" alt="3c9f45a79c1f481284829e9c1953b3d7-1652690853144"></p><p>执行完语句后，在指定路径中将生成相关html文件及其他依赖文件：</p><p><img src="'+n+'" alt="0dc0ef9f18c24b9985fdbc3387e6e3cc-1652690860051"></p><p>其中index.html文件为首页，通过浏览器打开即可看到通过文档注释所生成的文档具体内容：</p><p><img src="'+l+'" alt="014c97a9d38b485d8f9d4140e771394f-1652690867314"></p>',25),k=[h];function d(c,r,o,g,v,A){return i(),a("div",null,k)}const f=s(e,[["render",d]]);export{b as __pageData,f as default};
